"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([[4594],{17107:e=>{e.exports=JSON.parse('{"name":"GitHub Release","url":"https://github.com/woodpecker-ci/plugin-github-release","icon":"https://woodpecker-ci.org/img/logo.svg","description":"Add files and artifacts alongside a GitHub Release.","docs":"<h1>woodpecker-github-release</h1>\\n<p>Woodpecker plugin to add files and artifacts alongside a GitHub Release.</p>\\n<h2>Settings</h2>\\n<ul>\\n<li><code>api-key</code>: API key to access Github API</li>\\n<li><code>files</code>: list of files to upload</li>\\n<li><code>file-exists</code>: what to do if file already exist (default: <code>overwrite</code>)</li>\\n<li><code>checksum</code>: generate specific checksums</li>\\n<li><code>checksum-file</code>: name used for checksum file. \\"CHECKSUM\\" is replaced with the chosen method (default: <code>CHECKSUMsum.txt</code>)</li>\\n<li><code>checksum-flatten</code>: include only the basename of the file in the checksum file</li>\\n<li><code>draft</code>: create a draft release</li>\\n<li><code>prerelease</code>: mark the release as a pre-release</li>\\n<li><code>discussion-category</code>: create a discussion in the given category</li>\\n<li><code>base-url</code>: API url, needs to be changed for GHE (default <code>https://api.github.com/</code>)</li>\\n<li><code>upload-url</code>: upload url, needs to be changed for GHE (default: <code>https://uploads.github.com/</code>)</li>\\n<li><code>title</code>: file or string for the title shown in the GitHub release</li>\\n<li><code>note</code>: file or string with notes for the release (example: changelog)</li>\\n<li><code>overwrite</code>: force overwrite existing release information, e.g. title or note</li>\\n</ul>\\n<h2>Example</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n  release:\\n    image: woodpeckerci/plugin-github-release\\n    settings:\\n      files:\\n        - dist/*.tar.gz\\n        - dist/*.deb\\n        - dist/*.rpm\\n        - dist/checksums.txt\\n      title: ${CI_COMMIT_TAG##v}\\n      api-key:\\n        from_secret: github_token\\n</code></pre>\\n","tags":["github","publish","release"],"containerImage":"woodpeckerci/plugin-github-release","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-github-release","verified":true}')}}]);